import React from 'react';
import './NavBar.css';

function NavBar() {
  return (
    <div className="search-form">
    	<nav class="navbar navbar-light bg-light">
  			<a class="navbar-brand" href="#">
   			<img src="" width="30" height="30" alt="" loading="lazy"/>
  			</a>
		</nav>
    </div>
  );
}

export default NavBar;
